import React from "react";
import { Link, useLocation } from "react-router-dom";

export default function Navbar({
  balance,
  onLogout,
  search,
  setSearch,
  handleSearch,
}) {
  const location = useLocation();

  return (
    <div className="navbar-bg">
      <nav className="navbar">
        <div className="navbar-logo-section">
          <span className="navbar-logo">Rares's<br />project</span>
          <div className="navbar-menu">
            <Link
              to="/inventory"
              className={
                location.pathname === "/inventory"
                  ? "navbar-link active"
                  : "navbar-link"
              }
            >
              Inventory
            </Link>
            <Link
              to="/transfer"
              className={
                location.pathname === "/transfer"
                  ? "navbar-link active"
                  : "navbar-link"
              }
            >
              Transfer
            </Link>
            <Link
              to="/about"
              className={
                location.pathname === "/about"
                  ? "navbar-link active"
                  : "navbar-link"
              }
            >
                <Link to="/offers" className={location.pathname === "/offers" ? "navbar-link active" : "navbar-link"}>Offers</Link>

              About
            </Link>
          </div>
        </div>
        <div className="navbar-actions">
          <form className="navbar-search" onSubmit={handleSearch}>
            <input
              type="text"
              placeholder="Search..."
              value={search}
              onChange={(e) => setSearch(e.target.value)}
            />
            <button type="submit">SEARCH</button>
          </form>
          <div className="navbar-balance-chip">
            <span className="coin-emoji" role="img" aria-label="coin">
              🪙
            </span>
            <span className="navbar-balance-amount">
              {balance ? parseFloat(balance).toFixed(4) : "0.0000"}
            </span>
            <span className="navbar-balance-currency">ETH</span>
          </div>
          <button className="navbar-logout" onClick={onLogout}>
            Log<br/>Out
          </button>
        </div>
      </nav>
      <style>{`
        .navbar-bg {
          width: 100%;
          background: #f4f4f7;
          border-bottom: 1.2px solid #e5e7eb;
          box-shadow: 0 1.5px 12px #6366f103;
        }
        .navbar {
          display: flex;
          justify-content: space-between;
          align-items: center;
          max-width: 1200px;
          margin: 0 auto;
          padding: 18px 26px 12px 22px;
        }
        .navbar-logo-section {
          display: flex;
          align-items: flex-start;
          gap: 34px;
        }
        .navbar-logo {
          font-size: 2.1rem;
          font-weight: 700;
          color: #3730a3;
          letter-spacing: 0.12em;
          margin-right: 4px;
          line-height: 1.09;
          min-width: 130px;
          text-align: left;
          user-select: none;
        }
        .navbar-menu {
          display: flex;
          align-items: center;
          gap: 26px;
          margin-top: 9px;
        }
        .navbar-link {
          font-size: 1.08rem;
          font-weight: 600;
          color: #6b7280;
          text-decoration: none;
          padding-bottom: 3px;
          border-bottom: 2px solid transparent;
          transition: color .13s, border .13s;
        }
        .navbar-link.active {
          color: #6366f1;
          border-bottom: 2.5px solid #6366f1;
        }
        .navbar-actions {
          display: flex;
          align-items: center;
          gap: 18px;
        }
        .navbar-search {
          display: flex;
          align-items: center;
          gap: 7px;
          margin-right: 9px;
        }
        .navbar-search input {
          border: 1.3px solid #d1d5db;
          border-radius: 7px;
          font-size: 16px;
          padding: 7px 12px;
          background: #fff;
          min-width: 165px;
        }
        .navbar-search button {
          background: linear-gradient(90deg,#6366f1 60%,#5eead4 140%);
          color: #fff;
          font-weight: 700;
          border: none;
          border-radius: 7px;
          font-size: 15px;
          padding: 7px 18px 7px 18px;
          cursor: pointer;
          box-shadow: 0 2px 9px #6366f125;
          transition: background .15s;
        }
        .navbar-search button:hover {
          background: linear-gradient(90deg,#6366f1 100%,#06b6d4 200%);
        }
        .navbar-balance-chip {
          display: flex;
          align-items: center;
          background: linear-gradient(90deg, #fbbf24 80%, #facc15 140%);
          color: #fff;
          border-radius: 32px;
          padding: 7px 22px 7px 16px;
          font-size: 1.13rem;
          font-weight: 700;
          box-shadow: 0 3px 18px #facc1540;
          margin-right: 3px;
          gap: 8px;
          min-width: 132px;
        }
        .coin-emoji {
          display: inline-block;
          font-size: 1.25em;
          margin-right: 6px;
          animation: coin-spin 1.5s linear infinite;
          transform-origin: 55% 60%;
          filter: drop-shadow(0 2px 4px #0002);
          vertical-align: middle;
        }
        @keyframes coin-spin {
          0% { transform: rotateY(0deg);}
          70% { transform: rotateY(360deg);}
          100% { transform: rotateY(360deg);}
        }
        .navbar-balance-amount {
          color: #fff;
          font-weight: 900;
          letter-spacing: 0.02em;
        }
        .navbar-balance-currency {
          color: #ffe69c;
          font-size: 1em;
          font-weight: 700;
          margin-left: 4px;
          letter-spacing: 0.06em;
        }
        .navbar-logout {
          background: none;
          border: none;
          color: #6366f1;
          font-weight: 700;
          font-size: 1.08rem;
          cursor: pointer;
          padding: 0 0 0 7px;
          line-height: 1.13;
          transition: color .13s;
        }
        .navbar-logout:hover {
          color: #e11d48;
        }

        @media (max-width: 900px) {
          .navbar {
            flex-direction: column;
            gap: 12px;
            align-items: flex-start;
            padding: 13px 6vw 9px 6vw;
          }
          .navbar-actions { margin-top: 7px; }
        }
        @media (max-width: 650px) {
          .navbar-logo-section { flex-direction: column; gap: 7px; }
          .navbar-logo { font-size: 1.39rem; min-width: 0; }
          .navbar-actions { flex-direction: column; gap: 5px; }
          .navbar-menu { gap: 13px; }
        }
      `}</style>
    </div>
  );
}
